import{_ as t,c as o,o as n,ah as i}from"./chunks/framework.PvdZnrZd.js";const c=JSON.parse('{"title":"SHIPSTATION SHIPPING","description":"SHIPSTATION SHIPPING","frontmatter":{"title":"SHIPSTATION SHIPPING","description":"SHIPSTATION SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/shipstation.md","filePath":"zenith/featured-app/shipping/shipstation.md"}'),r={name:"zenith/featured-app/shipping/shipstation.md"};function a(l,e,s,p,h,g){return n(),o("div",null,[...e[0]||(e[0]=[i(`<p><a href="/zenith/introduction/">Multi-Vendor Marketplace for Shopify</a> is now Integrated with another shipping add-on: <strong>ShipStation</strong> .</p><h2 id="what-is-shipstation" tabindex="-1">What is ShipStation? <a class="header-anchor" href="#what-is-shipstation" aria-label="Permalink to &quot;What is ShipStation?&quot;">​</a></h2><p><strong><a href="https://www.shipstation.com/" target="_blank" rel="noreferrer">ShipStation</a></strong> is a web-based, multi-carrier shipping solution for ecommerce retailers. Designed to streamline the fulfillment process.</p><p>This feature will allow you to ship your goods via multiple carrier shipping methods. Moreover, you can automatically generate shipping labels.</p><p><strong>NOTE</strong></p><p><strong>ShipStation</strong> feature app is available only with the Multivendor <strong>Pro</strong> <strong>Plan</strong> ($60/month). Moreover, you need to enable the <a href="/zenith/featured-app/overview.html"><strong>Shipping</strong></a> add-on (free) from the &#39;feature apps&#39; section of the app.</p><p>Above all, access to Shipping requires your Shopify store to be on the plan that supports <strong>Real-Time Carrier-Calculated Shipping</strong>.</p><p>Also, you can enabled only one shipping method within ShipStation to calculate the shipping rates.</p><p><strong>CHARGES</strong></p><p>This feature will have an additional charge of <strong>USD 15 per month</strong> over &amp; above your current Multivendor Marketplace plan.</p><p>SHIPSTATION SHIPPING FEATURE APP IS AVAILABLE <strong>BOTH FOR RATE CALCULATION &amp; FULFILLMENT</strong>.</p><h3 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h3><p>The admin needs to visit the <strong>multi-vendor marketplace admin panel</strong> &gt; click on the <strong>three dots</strong> &gt; click on the <strong>feature apps</strong>. Further, <strong>enable</strong> the <strong>ShipStation</strong> feature app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/shpstation.webp" alt="Feature-Apps-Admin-2 ShipStation integration "></p><p>Furthermore, <strong>agree</strong> &amp; <strong>approve</strong> the charges:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/activateshipstation.webp" alt="Shipstation app approve charges"></p><h3 id="configuration-admin-end" tabindex="-1">Configuration: Admin End <a class="header-anchor" href="#configuration-admin-end" aria-label="Permalink to &quot;Configuration: Admin End&quot;">​</a></h3><p>Firstly, the admin needs to enable this shipping method from the shipping configuration. So, for this, visit:</p><p><strong>Multivendor marketplace admin panel</strong> &gt; <strong>configuration</strong> &gt; <strong>shipping configuration</strong>.</p><p>Click on the <strong>three dots</strong> under the <strong>Action</strong> menu &amp; further, click on <strong>enable</strong>.</p><p><strong>Note</strong>: Kindly choose only those shipping services which you need. Don&#39;t keep all the services selected otherwise it creates delay to retrieve shipping rates at the storefront.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/enableshipstation.webp" alt="Enable ShipStation Shipping Method"></p><p>Moving on, the admin needs to configure the ShipStation shipping method. So, for this, either click on <strong>Configure Shipping</strong> or go to <strong>multi vendor marketplace admin panel</strong> &gt;</p><p><strong>configuration</strong> &gt; <strong>ShipStation Configuration</strong></p><p>Refer:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/configureshipstation.webp" alt="ShipStation Configuration"></p><h3 id="configure-shipstation" tabindex="-1">Configure ShipStation <a class="header-anchor" href="#configure-shipstation" aria-label="Permalink to &quot;Configure ShipStation&quot;">​</a></h3><p>On the following page, configure the following details:</p><ul><li>Sandbox Mode: If you want to test the functionality of this shipping method, keep the sandbox mode enabled. Remember, shipping labels won&#39;t be generated in testing mode.</li><li>Automatic shipping label generation: By enabling this, the shipping label will be automatically generated at the tie of order fulfillment.</li><li>Usage as: Select whether you want to use shipstation for fulfillment or both fulfillment &amp; shipment.</li><li>Allow seller to configure their own shipstation account: In case you select fulfillment, you can let sellers add their details &amp; fulfill instead of yourself adding the details.</li><li>Choose a country on the basis of your ShipStation account: You have the option to choose from Canada, Australia, United States &amp; United Kingdom.</li><li>ShipStation API key: Enter API key provided by ShipStation.</li><li>ShipStation Secret key: Enter the Secret key provided by ShipStation.</li><li>Carrier Code: After entering all the keys, click on &#39;Get Carrier Code&#39; &amp; you&#39;ll get another option called CHOOSE SHIPPING SERVICE CODE FOR ORDER FULFILLMENT. After selecting this shipping service code &amp; saving the settings, the carrier code will be auto-generated.</li><li>Package: Choose the package type for order fulfillment &amp; shipping.</li><li>Shipping label cost is borne by: Choose who will bear the shipping label charges, the admin, or the seller. (This is an extra cost apart from what the customer has paid.)</li><li>Custom Dimension on fulfilment: Enabling this, you can allow sellers to add custom weight and dimensions for their order ignoring the product dimension and weight.</li><li>Restrict shipping method: Enabling this, you can restrict the sellers to only use the shipping method that has been selected by customer on their order. Only useful if you are using shipstation for both &quot;shipping and fulfilment&quot;.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/apiconfigshipstation.webp" alt="Shipstation-Configuration-Admin"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generalconfigshipstation.webp" alt="Shipstation_Configuration_Admin"></p><h3 id="set-shipping-method-for-sellers" tabindex="-1">Set Shipping Method For Sellers: <a class="header-anchor" href="#set-shipping-method-for-sellers" aria-label="Permalink to &quot;Set Shipping Method For Sellers:&quot;">​</a></h3><p>The admin can further set the shipping methods for his sellers.<br> Go to <strong>multi vendor marketplace admin panel</strong> &gt; <strong>Sellers</strong> &gt; <strong>Seller Listing</strong> &gt; <strong>Edit</strong> (under <strong>Action</strong>).</p><p>On the edit seller page, the admin will have the following block from where he can enable/disable/set as default:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/setdefaultshipstation.webp" alt="Set Default Shipping Method For Your Sellers (ShipStation integration )"></p><p>Further, the admin can view all the sellers which are using this shipping method by going to <strong>multi vendor marketplace admin panel</strong> &gt; <strong>configuration</strong> &gt; <strong>Shipping</strong> <strong>Configuration</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/viewsellersshipstation.webp" alt="View Sellers Using This Shipping Method (ShipStation integration )"></p><p>The redirected page:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/viewshippingmethod.webp" alt="View Seller Shipping Methods (ShipStation integration )"></p><p>Here, clicking on the &#39;Edit&#39; button for a particular seller will redirect you to the &#39;Edit Seller&#39; page from where you can disable the following shipping method for that seller .</p><h2 id="make-shipping-address-phone-number-mandatory" tabindex="-1">Make <strong>Shipping</strong> <strong>Address Phone Number</strong> Mandatory <a class="header-anchor" href="#make-shipping-address-phone-number-mandatory" aria-label="Permalink to &quot;Make **Shipping** **Address Phone Number** Mandatory&quot;">​</a></h2><p>To use this feature add-on, the admin needs to make the <strong>Shipping</strong> <strong>address phone number mandatory</strong> at the time of <strong>checkout</strong>.</p><p>So, to do this, go to <strong>Shopify Backend</strong> &gt; <strong>Settings</strong> &gt; <strong>Checkout</strong> &gt; Under <strong>Form Options</strong>, make <strong>Shipping</strong> <strong>address phone number</strong> as <strong>Required</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/demo-store-Checkout-Shopify-1200x597.png" alt="ShipStation integration ( making mobile no required ) "></p><p>Shopify Backend (Admin End)</p><h3 id="configuration-seller-end" tabindex="-1">Configuration: Seller End <a class="header-anchor" href="#configuration-seller-end" aria-label="Permalink to &quot;Configuration: Seller End&quot;">​</a></h3><p>Further, the seller can configuration ShipStation from his panel.</p><p>Go to <strong>multi vendor marketplace seller panel</strong> &gt; <strong>configuration</strong> &gt; <strong>shipping configuration</strong>&gt; <strong>enable</strong> the shipping:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/sellerenableshipstation.webp" alt="Enable ShipStation"></p><p>Furthermore, the seller can set the shipping method as <strong>by-default</strong> so that every single product created by him will have <strong>ShipStation</strong> as the <strong>by-default shipping method</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/shipstationsellerconfig.webp" alt="Set ShipStation As Default Shipping Method"></p><p>Clicking on &#39;<strong>Set As Default</strong>&#39; will give you the following dialogue box:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-2-1200x597.png" alt="Set Default Shipping Method For Products (ShipStation integration  )"></p><h3 id="in-case-the-admin-has-allowed-the-sellers-to-add-their-details" tabindex="-1">In case the admin has allowed the sellers to add their details: <a class="header-anchor" href="#in-case-the-admin-has-allowed-the-sellers-to-add-their-details" aria-label="Permalink to &quot;In case the admin has allowed the sellers to add their details:&quot;">​</a></h3><p>The seller will have this drop-down menu:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/01/image-1-1200x597.png" alt="shipstation configuration "></p><p>And further add these details:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/01/Shipstation-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-1-1084x1024.png" alt="Shipstation-Configuration-Seller-•-Multivendor-MarketPlace-1"></p><h3 id="set-default-shipping-method-for-products" tabindex="-1">Set Default Shipping Method For Products <a class="header-anchor" href="#set-default-shipping-method-for-products" aria-label="Permalink to &quot;Set Default Shipping Method For Products&quot;">​</a></h3><ul><li>For all products (old and new)</li><li>Only for new products</li><li>For products that don&#39;t have any shipping method on</li></ul><p>If not this, the seller can set the shipping method on individual products while adding/editing them.</p><p>So, go to <strong>Multi-vendor marketplace seller panel</strong> &gt; <strong>Products</strong> &gt;<strong>Product Listing</strong> &gt; <strong>Add</strong>/<strong>Edit</strong> the Product:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Screenshot-from-2019-12-04-15-13-53-1200x558.png" alt="Select shipping method for individual product (ShipStation integration  )"></p><h3 id="global-configuration" tabindex="-1"><strong>Global Configuration</strong> <a class="header-anchor" href="#global-configuration" aria-label="Permalink to &quot;**Global Configuration**&quot;">​</a></h3><p>Further, click on the <strong>Global Configuration</strong> menu:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-3-1200x597.png" alt="Shipping-Configuration-Seller-•-Multivendor-MarketPlace-3 (ShipStation integration  )"></p><p>So, from here, the seller can do the <strong>SHIPPING PACKET CONFIGURATION</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-6.png" alt="123"></p><p><strong>NOTE</strong>: It is mandatory to add product weight while creating one.</p><h3 id="shopify-store-frontend" tabindex="-1">Shopify Store Frontend <a class="header-anchor" href="#shopify-store-frontend" aria-label="Permalink to &quot;Shopify Store Frontend&quot;">​</a></h3><p>Likewise, the customer will have an option to select the shipping method as per configured from the backend after entering the information:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Shipping-JohnDoe2-Checkout-1200x955.png" alt="Shipping-JohnDoe2-Checkout"></p><h3 id="shipping-label-generation" tabindex="-1">Shipping Label Generation <a class="header-anchor" href="#shipping-label-generation" aria-label="Permalink to &quot;Shipping Label Generation&quot;">​</a></h3><p>Seller will have an option to generate the shipping label from their seller panel. Also, shipping labels can only be generated for <strong>fulfilled orders</strong>.</p><p><strong>Fulfilling order via ShipStation</strong>:</p><p>Go to <strong>Multi-vendor marketplace seller panel</strong> &gt; <strong>Orders</strong> &gt; <strong>Order Listing</strong> &gt; <strong>View</strong> (under <strong>Action</strong>). Select the method of order fulfillment as <strong>ShipStation</strong> and fulfill the order.</p><p>As soon as the order will be fulfilled, the shipping label will be automatically downloaded.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Order-Details-Seller-•-Multivendor-MarketPlace"></p><p>1. Click on Fulfill</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-2-1200x872.png" alt="Order-Details-Seller-•-Multivendor-MarketPlace-2"></p><p>Agree &amp; Fulfill: This block will have the information regarding who is bearing the shipping label charges.</p><p>Moreover, if you again want to download the shipping label, go to ADDITIONAL ORDER DETAILS, click on <strong>Actions</strong> &gt; <strong>Print Shipping Label</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-4-1200x597.png" alt="Order-Details-Seller-•-Multivendor-MarketPlace-4"></p><p>Furthermore, this is how the shipping label will be downloaded in pdf form:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/5512-pdf-2.png" alt="5512-pdf-2"></p><p>Page: 1</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/5512-pdf-1-1.png" alt="5512-pdf-1-1"></p><p>Page: 2</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/01/Shipstation-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-1084x1024.png" alt="Shipstation-Configuration-Seller-•-Multivendor-MarketPlace"></p><h3 id="allow-sellers-to-fulfill-orders-directly-from-their-shipstation-dashboard" tabindex="-1"><strong>Allow Sellers to fulfill orders directly from their Shipstation Dashboard.</strong> <a class="header-anchor" href="#allow-sellers-to-fulfill-orders-directly-from-their-shipstation-dashboard" aria-label="Permalink to &quot;**Allow Sellers to fulfill orders directly from their Shipstation Dashboard.**&quot;">​</a></h3><p>This new feature will create the order directly on seller’s Shipstation account and they Will be able to fulfill the order directly from Shipstation and further,</p><p>the fulfilment status and Tracking details will sync back to Marketplace app.</p><h3 id="configuration-from-admin-end" tabindex="-1"><strong>Configuration from Admin end</strong> <a class="header-anchor" href="#configuration-from-admin-end" aria-label="Permalink to &quot;**Configuration from Admin end**&quot;">​</a></h3><p>To configure this feature from the admin side, follow these steps</p><p>1. Navigate to the &#39;Configuration&#39; section and select &#39;ShipStation Configuration&#39;.</p><p>2. In the &#39;Usage As&#39; section, choose &#39;Fulfillment&#39; from the dropdown menu.</p><p>3. Enable &#39;&#39;ALLOW SELLER TO CONFIGURE THEIR OWN SHIPSTATION ACCOUNT&#39;&#39; button</p><p>4. Enable the &#39;Allow Seller to Register Webhook&#39; option.</p><p>5. We offer a customisation configuration in ShipStation that lets you choose the specific information displayed on each order Id with order id .</p><p>You can select to show the <strong>Admin shop name</strong>, <strong>Seller shop Name</strong>, or <strong>order ID Only</strong> in this .</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/09/shipstation-configuration.webp" alt="shipstation-configuration"></p><h3 id="configuration-from-seller-end" tabindex="-1"><strong>Configuration from seller end</strong> <a class="header-anchor" href="#configuration-from-seller-end" aria-label="Permalink to &quot;**Configuration from seller end**&quot;">​</a></h3><p>To configure this feature from seller end , follow these steps :</p><p>1.In the ShipStation configuration settings, enable the option for &#39;CREATE ORDER BEFORE FULFILLMENT &#39;.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/09/step-first-seller-end.webp" alt="shipstation-configuration-step1"></p><p>2. Copy the provided URL for &#39;Webhook Register for ShipStation shipping&#39; and configure it in the ShipStation dashboard.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/09/step-second-seller-end.webp" alt="shipstation-step-second -seller-end"></p><p>3. Once the order is created on the ShipStation dashboard, the ShipStation order ID will be displayed on the order detail page</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/09/step-third-seller-end.webp" alt="shipstation-step-third-seller-end"></p><p>4. if the order is fulfilled on shipstation dashboard then automatically it will be fulfilled on M ultivendor-market place as well.</p><p>Here is how you fulfill the order from Shipstation:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/09/step-fourth-seller-end.webp" alt="shipstation-step-first-seller-end"></p><p><strong>Note</strong> -</p><p>(1) It may take up-to 5 min to sync the fulfillment status and tracking details to Marketplace App after the order is fulfilled from Shipstation.</p><p>(2) Once the functionality is enabled, sellers need to go to their &quot;My Profile&quot; section and click &quot;Save Changes&quot; to update their profile.</p><p>This will create a warehouse for the seller&#39;s marketplace location.</p><p>(3)Orders will be fulfilled in their entirety, with no partial or item-by-item fulfillment allowed.</p><p>(4) If an order is canceled on the ShipStation dashboard, it will not be canceled in Multi Vendor marketplace.</p><p>(5) If an order has been fulfilled either partially or fully, then editing the order or removing an item will not update the order on the shipStation dashboard.</p><h3 id="drop-box" tabindex="-1"><strong>Drop Box</strong> <a class="header-anchor" href="#drop-box" aria-label="Permalink to &quot;**Drop Box**&quot;">​</a></h3><p>We’ve added an exciting new enhancement to the ShipStation shipping method — a feature called “Dropbox.”</p><p>This feature allows sellers to create custom shipping boxes, define their dimensions, manage temperature settings, and add dunnage materials for safer and more controlled deliveries.</p><h2 id="how-to-configure-and-use-this-feature-from-both-the-admin-and-seller-ends" tabindex="-1">How to configure and use this feature from both the admin and seller ends: <a class="header-anchor" href="#how-to-configure-and-use-this-feature-from-both-the-admin-and-seller-ends" aria-label="Permalink to &quot;How to configure and use this feature from both the admin and seller ends:&quot;">​</a></h2><p><strong>Enable Dropbox from the Admin Panel</strong></p><p>Start by enabling the Dropbox configuration from the <strong>admin panel</strong>.<br> This allows sellers to,</p><p>Create and define custom shipping box dimensions, set a minimum and maximum temperature range, and add dunnage materials to the box.</p><p><strong>Configure General Settings for ShipStation</strong></p><p>Navigate to the general configuration section of the ShipStation shipping method.<br> Enable all the options you want the sellers to have access to, then click <strong>Save</strong> to apply the settings.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/adminend-816x1024.webp" alt="admin"></p><h2 id="seller-configures-custom-box" tabindex="-1">Seller Configures Custom Box <a class="header-anchor" href="#seller-configures-custom-box" aria-label="Permalink to &quot;Seller Configures Custom Box&quot;">​</a></h2><p>From the seller panel, go to:<br> Shipping Methods → ShipStation → (Click the three dots on the right) → Configure Custom Box</p><p>Click on “Configure Custom Box”, then enable the toggle for “Create Custom Box for ShipStation.”</p><p>Once enabled, the “Add Custom Box” option will appear.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/sellerfrst-1200x701.webp" alt="frst"></p><p>**Select Custom Box Type<br> **Sellers can choose from two types of custom boxes:<br> 1. Normal Box – Allows you to set:<br> ◦ Box Dimensions<br> ◦ Dunnage Dimensions</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/sellerscnd-1200x609.webp" alt="scnd"></p><p>2. <strong>Climate Control Box</strong> – Allows you to set:</p><ul><li>Box Dimensions</li><li>Dunnage Dimensions</li><li>Minimum and Maximum Temperature</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/sellerthird-1018x1024.webp" alt="gb
"></p><p><strong>Save Custom Box</strong></p><p>After filling in the required details, click <strong>Save</strong> to store your custom box configuration.</p><p><strong>Apply Custom Box on Product</strong></p><p>When adding a new product or editing an existing one, go to the <strong>Product Listing Page</strong>.<br> Select <strong>ShipStation</strong> as the shipping method. You will now see options to:</p><ul><li>Apply the saved <strong>custom box</strong></li><li>Define <strong>box dimensions</strong></li><li>Add <strong>dunnage dimensions</strong></li><li>Set <strong>minimum and maximum temperature</strong> (if using climate control)</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/sellerfourth-1200x620.webp" alt="pro"></p><h2 id="how-it-appears-on-the-order-page" tabindex="-1">How it appears on the Order Page <a class="header-anchor" href="#how-it-appears-on-the-order-page" aria-label="Permalink to &quot;How it appears on the Order Page&quot;">​</a></h2><p><strong>When the seller selects</strong> <strong>a Normal box</strong>,</p><p>The Order page shows fields for box dimensions and dunnage dimensions only.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/orderscnd-1200x413.webp" alt="or"></p><p><strong>When the seller selects a Climate Control box,</strong></p><p>The Order page displays inputs for box dimensions, dunnage dimensions, and controlled temperature range (minimum and maximum).</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/orderfrst-1200x385.webp" alt="ord"></p>`,152)])])}const u=t(r,[["render",a]]);export{c as __pageData,u as default};
